    public class Grundstof {
        // Variable:
        int A; // Massetal
        int Z; // Protoner
        int N; // Neutroner

        string Navn;

        List<string> Henfald;
        string Type = "";

        // Konstrukt√∏rer:
        public Grundstof(string navn, List<string> henfald) {
            Navn = navn;
            Henfald = henfald;

            for(int i = 0; true; i++) {
                if(D.henfald.Keys.ElementAt(i) == navn) {
                    Z = i;
                    break;
                }
            }
        }

        // Metoder:
        public List<int> NyKerne(int neutroner) {
            N = neutroner;
            A = N + Z;
            List<int> nyKerne = new List<int> {Z, N};

            try {Type = D.henfald[Navn][N];} catch {Console.WriteLine("Ikke et muligt henfald");}
            
            switch(Type) {
                case "B+":
                nyKerne[0]--;
                nyKerne[1]++;
                break;

                case "B-":
                nyKerne[0]++;
                nyKerne[1]--;
                break;

                case "A":
                nyKerne[0] -= 2;
                nyKerne[1] -= 2;
                break;

                case "AB+":
                nyKerne[0] -= 2;
                nyKerne[1] -= 2;

                nyKerne.Add(Z - 1);
                nyKerne.Add(N + 1);
                break;

                case "AB-":
                nyKerne[0] -= 2;
                nyKerne[1] -= 2;

                nyKerne.Add(Z + 1);
                nyKerne.Add(N - 1);
                break;

                case "B+-":
                nyKerne[0]--;
                nyKerne[1]++;

                nyKerne.Add(Z + 1);
                nyKerne.Add(N - 1);
                break;

                case "AF":
                nyKerne[0] -= 2;
                nyKerne[1] -= 2;
                break;

                case " ":
                nyKerne[0] = -1;
                nyKerne[1] = -1;
                break;

                case "F":
                nyKerne[0] = 0;
                nyKerne[1] = 0;
                break;

                case "S":
                break;
            }
            return nyKerne;
        }
    }
}